import Link from "next/link";
import Head from "next/head";

const Header = () => (
  <div>
    <Head>
      <meta name="viewport" content="initial-scale=1.0, width=device-width" />
    </Head>
    <header className="odc-header">
      <nav className="odc-header--top">
        <Link href="/">
          <a>Settings</a>
        </Link>
        <Link href="/">
          <a>Notifications</a>
        </Link>
        <Link href="/">
          <a>Profile</a>
        </Link>
      </nav>
    </header>
    <style jsx>{`
      .odc-header {
        display: flex;
        flex-direction: row;
        position: fixed;
        background-color: #fff;
        padding: 1%;
        width: 100%;
        margin: 0;
        box-shadow: 0px 20px 35px 0px rgba(0, 0, 0, 0.5);
      }

      .odc-header--top {
        float: right;
      }

      a {
        text-decoration: none;
        color: blue;
        font-family: "Arial";
      }

      a:hover {
        opacity: 0.6;
      }
    `}</style>
  </div>
);

export default Header;
